import React from 'react';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom";
import Nav from './features/nav/Nav';
import HomePage from './pages/home/Home';


function App() {
  return (
    <div className="App">
      <Nav />
      <Router>
        <Switch>
          <Route exact path="/">
            <HomePage />
          </Route>
          <Route path="/login">
            <LoginPage />
          </Route>
        </Switch>
    </Router>
      {/* Footer */}
    </div>
  );
}

export default App;
